import{_ as e,o as a,c as t,a as i}from"./app.57a3dbd1.js";const r="/assets/tem.c1c4238f.png",m=JSON.parse('{"title":"图像识别类","description":"","frontmatter":{"contributors":["ZhouYixun"]},"headers":[{"level":2,"title":"注意事项","slug":"注意事项","link":"#注意事项","children":[]},{"level":2,"title":"图片点击","slug":"图片点击","link":"#图片点击","children":[]},{"level":2,"title":"相似度匹配","slug":"相似度匹配","link":"#相似度匹配","children":[]}],"relativePath":"doc/doc-sift.md","lastUpdated":1716537034000}'),s={name:"doc/doc-sift.md"},c=i('<h1 id="图像识别类" tabindex="-1">图像识别类 <a class="header-anchor" href="#图像识别类" aria-hidden="true">#</a></h1><p>使用图像识别类操作注意事项与教学。</p><h2 id="注意事项" tabindex="-1">注意事项 <a class="header-anchor" href="#注意事项" aria-hidden="true">#</a></h2><p>Sonic 目前使用的图像库基于 <a href="https://github.com/SonicCloudOrg/sonic-vision-core" target="_blank" rel="noreferrer">sonic-vision-core</a> 建设。如果您的图像类操作报类似丢失依赖的错误，请检查 Agent 的 jar 包与您的平台是否匹配。</p><div class="warning custom-block"><p class="custom-block-title">注意</p><p>已知部分Mac arm64系统使用该功能会出现问题，可以尝试下载 Mac x86_64 的 Agent 并将 Mac x86_64 的jar替换原本的 arm64 jar（只替换jar即可，无需替换plugins下的二进制文件，否则plugins下的插件因没有对应系统架构而使用失败）</p></div><h2 id="图片点击" tabindex="-1">图片点击 <a class="header-anchor" href="#图片点击" aria-hidden="true">#</a></h2><p>使用图片点击时，需确保：</p><ol><li>图片足够复杂，不是单一简洁图片，<strong>越复杂识别精确度越高</strong>。</li><li>该图片后续变动不大，仅仅可能有位置变动。</li></ol><p>使用方法：</p><ol><li>可以直接在【控件元素】页面获取当前实时控件树，在对应控件详细信息使用【控件快照】保存控件的截图信息。</li><li>选择【图片点击控件】步骤，选择对应控件即可。</li><li>如果为自定义截图信息，可以直接前往控件元素页面自行上传图片，然后添加到项目中。</li></ol><p>效果如图：</p><p><img src="'+r+'" alt="tem"></p><div class="warning custom-block"><p class="custom-block-title">默认图像识别算法顺序</p><p>SIFT 算法 -&gt; AKAZE 算法 -&gt; 模版匹配方法</p></div><h2 id="相似度匹配" tabindex="-1">相似度匹配 <a class="header-anchor" href="#相似度匹配" aria-hidden="true">#</a></h2><p>即断言对应图片与当前设备截图的相似程度。如果不在期望范围内，将抛出异常。</p>',15),l=[c];function o(n,d,p,h,_,u){return a(),t("div",null,l)}const f=e(s,[["render",o]]);export{m as __pageData,f as default};
